import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const favseries = 'amazon';

const FavS = () => {

    if(favseries === 'netflix'){
        return(
        <Netflix/>
    );
}else {
  return(
    <Card
    key={Sdata[5].id}
    imgsrc={Sdata[5].imgscr}
    sname={Sdata[5].sname}
    title={Sdata[5].title}
    link={Sdata[5].link}
    />
);
}
};




const App = () => (
  <>
    <h1 className="heading_style"> List of top 5 Netflix Series in 2024</h1>
    <FavS />
  </>
);

export default App;
